import React from 'react';
import styled from 'styled-components';
import SmoothCorners from '../components/common/SmoothCorner';

const CirclesContainer = styled.div`
  display: flex;
  justify-content: space-between;
  align-items: center;
  flex-wrap: wrap;
  width: 1.5rem;
  height: 1.6rem;
`;

const Circle = styled.span`
  width: 5px;
  height: 5px;
  border: 1.4px solid var(--ui-04);
  border-radius: 50%;
`;

const NavButton = () => {
  return (
    <SmoothCorners>
      <CirclesContainer>
        <Circle />
        <Circle />
        <Circle />
        <Circle />
      </CirclesContainer>
    </SmoothCorners>
  );
};

export default NavButton;
